// src/assets/brand-logo.ts
/**
 * BreederHQ brand logo (120x120 PNG, ~26 KB) inlined as base64.
 * Avoids runtime path resolution issues between src/ and dist/.
 */

const LOGO_BASE64 = "";

let _logoPngBytes: Uint8Array | null = null;

/**
 * Returns the BreederHQ logo as a PNG byte buffer for pdf-lib embedding.
 * Cached after first decode.
 */
export function getBrandLogoPng(): Uint8Array {
  if (!_logoPngBytes) {
    _logoPngBytes = Uint8Array.from(Buffer.from(LOGO_BASE64, "base64"));
  }
  return _logoPngBytes;
}
